@SpringBootTest
public class ImageUrlEncode {
  @Test
  public void test() throws UnsupportedEncodingException {
    String str = "";
    String str2 = "";
    int length = str.length();
    StringBuilder sb = new StringBuilder();
    for (int i=0;i<length;i+=20) {
      int val = Math.min(length,i+20);
      sb.append(URLEncoder.encode(str.substring(i,val),StandardCharsets.UTF_8.toString()));
    }
    for (int i=0;i<str2.length();i+=20) {
      int val = Math.min(str2.length(),i+20);
      sb.append(URLEncoder.encode(str2.substring(i,val),StandardCharsets.UTF_8.toString()));
    }
    System.out.println(sb.toString());
  }
}
